import "../../../../../../styles/sidebar.css";
import AdminService from "../../../../../../service/AdminService";
import AutenticationService from "../../../../../../service/AutenticationService";

const handleAllCustomer = () => {
  AdminService.getAllCustomers().then(
    response => {
      props.setCompanies(response.data);
    },
    (error) => {
      try {
        if (error.response.data.string) {
          alert("There are no customers")
          return;
        }
        if (error.response) {
          alert("Login expired, please login again.");
          AutenticationService.logOut();
        }
      } catch {
        alert("Servers are down, please try again later.");
        AutenticationService.logOut();
      }
    }
  )
}


export default function AdminCustomersSidebar() {
  return (
    <>
      <div className="sidebar-top"></div>
      <div className="side-bar">
        <div className="side-bar-div">
          <button className="side-bar-button" title="All Coupons" onClick={handleAllCustomer}>
            All Customers
        </button>
        </div>
        <div className="side-bar-div">
          <button className="side-bar-button" title="Coupons By Category">
            Search By Id
        </button>
        </div>
        <div className="side-bar-div">
          <button className="side-bar-button" title="All Coupons">
            Serch By Email
        </button>
        </div>
        <div className="side-bar-div">
          <button className="side-bar-button" title="All Coupons">
            Add Customer
        </button>
        </div>
        <div className="side-bar-div">
          <button className="side-bar-button" title="All Coupons">
            Update Customer
        </button>
        </div>
        <div className="side-bar-div">
          <button className="side-bar-button" title="All Coupons">
            Delete Customer
        </button>
        </div>
      </div>

    </>
  );
}
